import React from 'react';

function nav() {
    return (
        <div>
            <div className='navContainer'>
                <ul>
                    <li>Service</li>
                    <li>AboutUs</li>
                    <li>Our Work</li>
                    <li>Contact</li>
                   
                </ul>

            </div>
        </div>
    );
}

export default nav;
